import {makePostHelper} from "../javascript/Server"

const Expect = (func,...args) =>  {
    console.log(...args)
    try {
        func(...args)
    } catch (exception) {
        return exception
    }
}

const testMakePost = () => {
    const flawPostObj = {
        author : "Wonjae Lee"
    }

   Expect(makePostHelper, "testPosts", flawPostObj)
}

export const runTests = () => {
    testMakePost();
}
